import pandas as pdfrom yahoofinancials import YahooFinancialsimport datetime as dttickers = ["2800.HK", "2823.HK"]close_prices = pd.DataFrame()end_date = (dt.datetime.today()).strftime('%Y-%m-%d')start_date =(dt.datetime.today()).strftime('%Y-%m-%d')time_interval = "daily"yf_json = YahooFinancials("AAPL").get_historical_price_data(start_date, end_date, time_interval)# extracting historic close price stock data for a list of stocksfor ticker in tickers:    yf = YahooFinancials("2800.HK")    json_obj = yf.get_historical_price_data(start_date, end_date, time_interval)    ohlv = json_obj["2800.HK"]['prices']    temp = pd.DataFrame(ohlv)[["formatted_date", "adjclose"]]    temp.set_index("formatted_date", inplace=True)    temp.dropna(inplace=True)    close_prices["2800.HK"] = temp["adjclose"]        # extracting stock data(ohlcv) for the stocks identifiedohlcv_dict = {}end_date = dt.datetime.today().strftime("%Y-%m-%d")start_date = (dt.datetime.today() - dt.timedelta(1825)).strftime("%Y-%m-%d")for ticker in tickers:    yf = YahooFinancials(ticker)    json_obj = yf.get_historical_price_data(start_date, end_date, time_interval)    ohlcv = json_obj[ticker]["prices"]    temp = pd.DataFrame(ohlcv)[["formatted_date", "adjclose", "open","low","high","volume"]]    temp.set_index("formatted_date", inplace=True)    temp.dropna(inplace=True)    ohlcv_dict[ticker] = temp["dropna"]            